            padding-bottom: 4rem;
            padding-bottom: var(--container-padding-bottom)
        }

        swiper-container::part(button-next),
        swiper-container::part(button-prev) {
            background: #1189d5;
            border-radius: 9999px;
            bottom: 0;
            box-sizing: border-box;
            height: var(--swiper-navigation-size);
            padding: calc(var(--swiper-navigation-size)/3);
            position: absolute;
            top: unset;
            width: var(--swiper-navigation-size);
            z-index: 20
        }

        swiper-container::part(button-prev) {
            left: calc(50% - min(var(--swiper-navigation-offset), 50%));
            translate: 1rem 0
        }

        swiper-container::part(button-next) {
            right: calc(50% - min(var(--swiper-navigation-offset), 50%));
            translate: -1rem 0
        }

        swiper-container::part(pagination) {
            bottom: calc(var(--swiper-navigation-size)/2);
            translate: 0 50%
        }

        swiper-container::part(bullet) {
            background-color: gray
        }

        swiper-container::part(bullet-active) {
            background-color: #80808033;
            border-radius: 9999px;
            overflow: hidden;
            position: relative
        }

        swiper-container::part(bullet-active):after {
            background-color: #1189d5;
            content: "";
            top: 0;
            right: 0;
            bottom: 0;
            left: 0;
            inset-inline-end: 0;
            inset-inline-end: calc(var(--progress, 0)*100%);
            position: absolute
